import React, { Component } from "react";
import PostBox from "../../Components/PostBox";
import './PostingScreenStyle.css';

export default class PostingScreen extends Component{
    state={
        loading: true,
        posts: null,
    }

    constructor(props){
        super(props);

        this.postData('https://localhost:5001/posts')
            .then((data)=>{
                console.log(data);
            });

    }

    render(){
        return(
            <div id="pageBox">
                {
                    this.state.loading && !this.state.posts ? (<></>
                    ) : (
                    <PostBox title="hello" description="world"></PostBox>
                )}
            </div>
        );
    }

    async postData(url = '') {
        // Default options are marked with *
        const response = await fetch(url, {
          method: 'GET', // *GET, POST, PUT, DELETE, etc.
          mode: 'no-cors', // no-cors, *cors, same-origin
          headers: {
            'Content-Type': 'application/json'
          }
        });
        return response.json(); // parses JSON response into native JavaScript objects
    }
}
